import axios from 'axios';
import React, { useState, useEffect } from 'react';
import { LineChart, Line } from 'recharts';

function ReservoirData(props) {

    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    // const [error, setError] = useState(null);

    useEffect(() => {
        const url = '/dynamicapp/req/JSONDataServlet?Stations=ORO&SensorNums=15&dur_code=D&Start=2023-07-24&End=2023-08-24';
        axios.get(url)
            .then(response => {
                setData(response.data);
                console.log(data);
                setLoading(false);
                // console.log(data);
                // console.log(response.data);
            })
            .catch(error => {
                console.log(error)
                // setError(error);
                // setLoading(false);
            })
    }, [])

    if (loading) {
        return <p>Loading...</p>;
    }

    // if (error) {
    //     return <p>Error: {error.message}</p>;
    // }

    // return (
    //     <div>
    //         <h1>API Response:</h1>
    //         <ul>
    //             {data.map(item => (
    //                 <li key={item.id}>{item.title}</li>
    //             ))}
    //         </ul>
    //     </div>
    // );

    return (
        <div className="ReservoirCard">
            <h3>
                {props.name}

                <div>
                    <ul>
                        {data.map(item => (
                            <li >{item.stationId}</li>
                        ))}
                    </ul>
                </div>

            </h3>
        </div>
    )
}

export default ReservoirData;
